window.bookSummaryJSON = "<p>In late summer of 1994, Jack Noble, a former All-American quarterback, is in the middle of the toughest event he's ever taken part in: marine corps recruit training. After eight weeks he's managed to make enemies of every drill instructor and every recruit in his platoon. Then on one particularly humid South Carolina day, an odd sequence of events changes everything. Contains an excerpt of <i>Noble Intentions: Episode 1</i>. </p>"; 
